import React from 'react';

class BuilingList extends React.Component {


	filterBuildingName = (buildingNameFilter) => {
	    let filteredBuildings = this.state.buildingList
	    filteredBuildings = filteredBuildings.filter((building) => {
	      let name = building.name.toLowerCase()
	      return name.indexOf(
	        buildingNameFilter.toLowerCase()) !== -1
	    })
	    this.setState({
	      filteredBuildings
	    })
	  }

	tappedBuilding = (e) => {
		e.preventDefault()
		console.log('Building ID: ' + e.target.id);
	}

	render() {
		//console.log('This is my directory file', this.props.data);
		const { data } = this.props;

		const buildingList = data.map(directory => {
			return (
				<tr key={directory.id} onClick={() => this.tappedBuilding(directory.id)}>
					<td>{directory.code} DICK</td>
					<td> {directory.name} </td>
				</tr>
			);
		});

		return <div>{buildingList}</div>;
	}
}
export default BuilingList;
